import React, { Fragment } from 'react'
import { Link } from 'react-router-dom'

export default function Leftbar() {

  const leftSidebarContent = [
    {
      title: 'PUBLIC',
      link: 'null'
    },
    {
      title: 'Questions',
      link: '/questions'
    },
    { 
      title: 'Tags',
      link: '/tags'
    },
    {
      title: 'Users',
      link: '/users'
    },
    {
      title: 'Companies',
      link: '/companies'
    }
  ]
  return (
    <React.Fragment>
    <div className='h-screen bg-stone-700 w-3/12 hidden sm:flex sm:flex-col sm:justify-start'>
      {/* <h4>Public</h4> */}
      <ul className='text-left relative top-16 px-6 w-full'>
        {leftSidebarContent.map((item, index) => (

          <li key={index} className='w-full active:bg-gray-700 active:border-l-4  py-1 '>
            <Link className=' text-sm text-white' to={item.link}>{item.title}</Link>
          </li>

        ))}
      </ul>
    </div>
    </React.Fragment>
  )
}
